import classes from "./User.module.css";

const User = (props) => {
  return (
    <li className={classes.meal}>
      <div>
        <h3>{props.username}</h3>
        <div className={classes.description}>{props.bio}</div>
        <div className={classes.price}>{props.location}</div>
        <div className={classes.description}>{props.name}</div>
        <div className={classes.price}>{props.mail}</div>
      </div>
    </li>
  );
};

export default User;
